    let distance = (dx * dx + dy * dy) as u32;
    if distance > MAX_DISTANCE {
      MAX_DISTANCE as u16
    } else {
      distance as u16
    }
}


pub fn is_visible(enemy_advance: u8, x: u8) -> bool {
    //(x >= enemy_advance) == (side == 0)
    x >= enemy_advance
}

